import React from 'react';
import logo from './logo.svg';
import './App.css';
import Main from './Main';
import Footer from './Footer';
import Maps from './Maps'
import Main1 from './Main1'
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
    <li><Link exact to={'/'} className="nav-link text-dark "><b>Main</b></Link></li>
    <li><Link exact to={'/Main1'} className="nav-link text-dark"><b>Main1</b></Link></li>

      <Route exact path="/" component={Main} />
      <Route exact path="/Main1" render={ localStorage.stu} /> 
      <Footer />
    </div>
    </Router>

  );
}

export default App;
